INSERT INTO main_app_brand(name, img, bio, verified_brand, created_at)
  VALUES
    ('Louis Vuitton','https://i.scdn.co/image/ab6772690000dd2244ad781bd757187ff17ce91b','AC/DC''s mammoth power-chord roar became one of the most influential hard rock sounds of the ''70s and one of the defining sounds of rock and metal. In its own way, it was a reaction to the pompous art rock and lumbering arena rock of the early ''70s. AC/DC''s rock was minimalist -- no matter how huge and bludgeoning their guitar chords were, there was a clear sense of space and restraint.','t','2021-05-07 18:57:42.517205-07');
